import * as React from 'react';
import './App.css';
import CreateTweet from './component/CreateFriendList'
import Header from './component/AppBar'
import ShowComments from './component/ShowTweets'
import {AppBar, Toolbar, Typography} from '@material-ui/core'


const App = () => {

  return (
    <div className="App">
      {/* <Header /> */}
      <AppBar position="static" style={{backgroundColor:'black', width:'500px'}}>
        <Toolbar>
          <Typography variant="h6" >
            The FriendList Header
          </Typography>
        </Toolbar>
      </AppBar>
      <CreateTweet />
      <ShowComments />
    </div>
  );
}


export default App;
